import { Card, Typography } from '@mui/material'
import { Box, Container } from '@mui/system'
import React from 'react'

const CardFoodType = () => {
    return (
        <Box
        sx={{
            width: '200px',
            height: '186px',
            justifyContent: 'center',
            alignItems: 'center'
        }}>

        </Box>
    )
}

const ListFoodType = () => {
  return (
    <Box>
        <Container 
        maxWidth='xl' 
        sx={{ marginTop: '95px'}}>
            <Typography fontSize='32px' color='primary' fontWeight={600}>
            More food type as you can choose
            </Typography>

            <Container
            sx={{
              gap: '24px',
              marginTop: '80px',
              display: 'grid',
              gridTemplateColumns: 'repeat(4, 1fr)',
              rowGap: '60px'
            }} >
                <CardFoodType/>

            </Container>
        </Container>
    </Box>
  )
}

export default ListFoodType
